-- ----------------------------
-- View structure for dp_project_stats
-- ----------------------------
DROP VIEW IF EXISTS `dp_project_stats`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `dp_project_stats` AS select `p`.`project_name` AS `project_name`,count(distinct (case when (`m`.`status` = 3) then `m`.`id` end)) AS `status3_count`,count(distinct (case when (cast(from_unixtime(`ci`.`create_time`) as date) = (curdate() - interval 1 day)) then `ci`.`member_id` end)) AS `yesterday_check_in_count`,count(distinct (case when (cast(from_unixtime(`ci`.`create_time`) as date) = curdate()) then `ci`.`member_id` end)) AS `today_check_in_count` from ((`dolphin`.`dp_clock_project` `p` left join `dolphin`.`dp_clock_member` `m` on((`p`.`pid` = `m`.`project_id`))) left join (select distinct `dolphin`.`dp_clock_in`.`member_id` AS `member_id`,`dolphin`.`dp_clock_in`.`project_id` AS `project_id`,cast(from_unixtime(`dolphin`.`dp_clock_in`.`create_time`) as date) AS `check_in_date`,`dolphin`.`dp_clock_in`.`create_time` AS `create_time` from `dolphin`.`dp_clock_in`) `ci` on(((`m`.`id` = `ci`.`member_id`) and (`p`.`pid` = `ci`.`project_id`)))) where (`p`.`status` = 0) group by `p`.`project_name`;

SET FOREIGN_KEY_CHECKS = 1;
